// src/Footer.js
import React from 'react';
import './  '

const Footer = () => (
  <footer className="footer">
    <section id="footer">
    <p>Thank you for visiting our website</p>
    <div className="social-links">
      <a href="#">Facebook</a> <br/>
      <a href="#">Twitter</a> <br/>
      <a href="#">LinkedIn</a>
    </div>
    </section>
  </footer>
  
);

export default Footer;
